import './App.css';
import { Post } from "./Post";
import { Header } from "./Header";
import { Route, Routes } from "react-router-dom";
import Layout from './Layout';

function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<Layout />}>

        <Route index element={

          <Post />

        } />
        <Route index element={
          <div>Login page</div>

        }>
        </Route>
            </Route>
    </Routes>
    </>
  )
}

export default App;
